"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     37.5-25 mg (100): $140.90",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      Capsules",
"     </b>",
"     (Triamterene-HCTZ Oral)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     37.5-25 mg (100): $41.37",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      Tablets",
"     </b>",
"     (Maxzide Oral)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     75-50 mg (100): $357.88",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      Tablets",
"     </b>",
"     (Maxzide-25 Oral)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     37.5-25 mg (100): $159.58",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      Tablets",
"     </b>",
"     (Triamterene-HCTZ Oral)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     37.5-25 mg (100): $39.27",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     75-50 mg (100): $91.68",
"    </p>",
"   </div>",
"   <div class=\"block mop drugH1Div\" id=\"F5661495\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Monitoring Parameters",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Monitor blood pressure, serum electrolytes, BUN, creatinine, liver function tests, signs of hyperkalemia",
"    </p>",
"   </div>",
"   <div class=\"list fbnlist drugH1Div drugBrandNames\" id=\"F179777\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     International Brand Names",
"    </span>",
"    <ul>",
"     <li>",
"      Anjal (TW);",
"     </li>",
"     <li>",
"      Apo-triazide (HK);",
"     </li>",
"     <li>",
"      Dinazide (TH);",
"     </li>",
"     <li>",
"      Diuracet-K (PE);",
"     </li>",
"     <li>",
"      Dyazide (AE, BB, BF, BH, BJ, BM, BS, BZ, CH, CI, CY, EG, ET, GB, GH, GM, GN, GY, HK, IE, IL, IQ, IR, JM, JO, JP, KE, KW, LB, LR, LY, MA, ML, MR, MU, MW, MX, MY, NE, NG, OM, PH, PK, PT, QA, SA, SC, SD, SL, SN, SR, SY, TH, TN, TT, TW, TZ, UG, YE, ZA, ZM, ZW);",
"     </li>",
