"   <div class=\"block pha drugH1Div\" id=\"F179756\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Based on",
"     <b>",
"      triamterene",
"     </b>",
"     component: Blocks epithelial sodium channels in the late distal convoluted tubule (DCT) and collecting duct which inhibits sodium reabsorption from the lumen. This effectively reduces intracellular sodium, decreasing the function of Na+/K+ ATPase, leading to potassium retention and decreased calcium, magnesium, and hydrogen excretion. As sodium uptake capacity in the DCT/collecting duct is limited, the natriuretic, diuretic,  and antihypertensive effects are generally considered weak.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Based on",
"     <b>",
"      hydrochlorothiazide",
"     </b>",
"     component: Inhibits sodium reabsorption in the distal tubules causing increased excretion of sodium and water as well as potassium and hydrogen ions",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F179771\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     See individual agents.",
"    </p>",
"   </div>",
