" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Epidemiology, pathology, and pathogenesis of dementia with Lewy bodies",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"mobipreview.htm?33/41/34455/contributors\">",
